import React, {useState} from "react";
import MyCounter from "./dev/components/Counter";
import MyInput from "./dev/components/Input";
import "./styles/App.css";
import MyPostItem from "./dev/components/PostItem";
import PostItem from "./dev/components/PostItem";
import PostList from "./dev/components/PostList";
import MyButton from "./dev/components/UI/button/MyButton";

function App() {

    const [posts, setPosts] = useState([
        {id: 1, title: 'JavaScript', body: 'Description'},
        {id: 2, title: 'Python', body: 'Description'},
        {id: 3, title: 'Java', body: 'Description'},
    ])

    return (
        <div className="App">
            <form action="">
                <input type="text" placeholder="Name post"/>
                <input type="text" placeholder="Description post"/>
                <MyButton>create post!</MyButton>
            </form>
            <PostList posts={posts} title='List Posts One'/>
        </div>);
}

export default App;
